import React, { useState } from 'react'

const ExpenseHistory = () => {
    return (
        <div>
           
                    <div className='row'>
                    <button type='submit' className='w-1/3 bg-purple text-white col' style={{marginTop:"0.8rem", marginRight:"5px", padding:'5px'}}>Add Transaction</button>
                    <button type='submit' className='w-1/3 bg-purple text-white col' style={{marginTop:"0.8rem",padding:'5px'}}>View History</button>
                    </div>
            
        </div>
    )
}

export default ExpenseHistory
